import React from 'react';
import Container from '@material-ui/core/Container';
import BasicTextFields from '../Components/TextField';
import Typography from '@material-ui/core/Typography';
import BasicTabs from '../Components/Homepage/Tabmenu';
import YouTubeIcon from '@mui/icons-material/YouTube';
import TwitterIcon from '@mui/icons-material/Twitter';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import FacebookIcon from '@mui/icons-material/Facebook';
import ControlledAccordions from '../Components/Accordion2';
import CopyrightIcon from '@mui/icons-material/Copyright';
import SwipeableTextMobileStepper from '../Components/Stepper';
import Airtel from './../Assets/Airtel.png';
import SimpleCard1 from '../Components/Homepage/Card1';
import SimpleCard2 from '../Components/Homepage/Card2';

export default function Home() {
  return (
    <React.Fragment>
        <Container fixed>
        <img src={Airtel} />
        <BasicTabs/>  
        <BasicTextFields/> 
        <SimpleCard1/>
        <SimpleCard2/>
        <SwipeableTextMobileStepper/>
        <Typography variant="h5" component="h2">
          Entertainment
        </Typography>
        <FacebookIcon/>
        <LinkedInIcon/>
        <TwitterIcon />
        <YouTubeIcon />
        <ControlledAccordions/>
        <p>
        <CopyrightIcon/> 2021 Airtel India. All Rights Reserved.
        </p> 
        </Container>
    </React.Fragment>
  );
}
